import React from "react";

function AboutUs(){
  return (
    <div >
        <div className="container">
         <div className="content">
            <h1>History</h1>
            <p>Our Parent School – National Public School Shivpura
National Public School started its journey in the year 1959 under the pioneering effort and careful nurturing by our Founder Chairman of NPS Group of Institutions Dr. K P Gopalkrishna and Senior Principal Dr. Santhamma Gopalkrishna. NPS has been known for its academic excellence, discipline and ethical practices which stands tall and high even to this day in the field of education. The group of schools is the result of the foresight and a noble effort of nation-building. NPS school community stands committed to transform learners into responsible citizens by developing them through the modern work culture of the present world and instilling the moral and ethical values in the roots of their heart and mind.
Drawing on the legacy of the NPS Group of Institutions and the innovative, immersive methods of school systems around the world, our schools were instituted with one aim – to teach children not just what to learn, but how to learn.
</p>
</div>
        </div>
    </div>
  );
}

export default AboutUs;
